"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Rabies (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/rabies-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H17587912\">",
"      <span class=\"h1\">",
"       What is rabies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Rabies is a disease caused by a virus. The virus spreads by bites or scratches from animals that have rabies. It gets into the body from the animal&rsquo;s saliva and spreads to the brain.",
"     </p>",
"     <p>",
"      In the United States, certain wild animals are more likely than other animals to give people rabies. These animals include bats, raccoons, skunks, foxes, and coyotes. Bat bites are especially likely to spread rabies.",
"     </p>",
"     <p>",
"      In countries in Africa and Asia, dogs are the most likely wild animal to spread rabies. That&rsquo;s because in these countries, most dogs do not get a rabies shot. But other animals can also spread rabies in these countries.",
"     </p>",
"     <p>",
"      Rabies is a very serious disease. People infected with rabies almost always die if they do not get treatment right away, before symptoms start.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17587927\">",
"      <span class=\"h1\">",
"       What are the symptoms of rabies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Rabies symptoms in humans include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Feeling sick, like you have the flu &ndash; A person with rabies might not feel like eating. He or she might have a fever, sore throat, headache, nausea, and vomiting.",
"       </li>",
"       <li>",
"        Acting irritable, excited, or more active than normal",
"       </li>",
"       <li>",
"        Painful or tingling areas on the skin",
"       </li>",
"       <li>",
"        Fear of water or choking on water",
"       </li>",
"       <li>",
"        Weakness in the arms and legs &ndash; A person with this symptom might also leak urine.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Animals with rabies can act strangely. For example, they might:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Attack people and other animals",
"       </li>",
"       <li>",
"        Come out in daylight when they are normally out at night &ndash; For example, bats and raccoons are not usually out during the day.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17587942\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. See a doctor or nurse right away if:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        You are bitten by a wild animal, especially a bat, raccoon, skunk, fox, or coyote.",
"       </li>",
"       <li>",
"        You were around a bat or woke up in the room with a bat (bat bites can be hard to see). &nbsp;",
"       </li>",
"       <li>",
"        You were bitten by a dog, cat, or ferret you know or think has rabies. You should also see a doctor or nurse if you do not know if the dog, cat, or ferret that bit you had rabies shots. Many pets in the United States get rabies shots, but not all do.",
"       </li>",
"       <li>",
"        You are in a country where rabies is common (for example, an African or Asian country) and an animal bites or scratches you.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17587959\">",
"      <span class=\"h1\">",
"       Can doctors tell if the animal that bit me has rabies?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Sometimes. If a pet bites you and it seems healthy, it can go to a safe place such as an animal hospital for doctors to watch it. Doctors can watch it for 10 days to see if it gets sick. If it stays healthy, you do not need rabies shots. If the pet gets sick, you need shots right away.",
"     </p>",
"     <p>",
"      If a wild animal bites you, or a strange pet bites you and gets away, you might need rabies shots. See your doctor or nurse right away. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17587976\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Some other diseases cause symptoms similar to rabies. A doctor might do tests to look for these diseases.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17587993\">",
"      <span class=\"h1\">",
"       How is rabies treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Once rabies symptoms start, no treatment works well. Most people with rabies symptoms die. That is why preventing rabies is so important. If you think you were exposed to rabies, getting treatment right away can stop the virus from spreading in your body and causing symptoms. &nbsp;",
"     </p>",
"     <p>",
"      If a person has rabies symptoms, doctors can give treatments to make him or her more comfortable. These treatments are given in the hospital. They include treatments to relieve pain and trouble breathing.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17588008\">",
"      <span class=\"h1\">",
"       Can rabies be prevented?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If an animal bites you, do these things right away:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Wash the wound with lots of soap and water, even if it stings you. You can also use an antiseptic such as povidone-iodine (brand name: Betadine&reg;).",
"       </li>",
"       <li>",
"        Call your doctor or nurse, or go to the emergency room right away.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Other ways to prevent rabies:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        If you have pets, make sure they get rabies shots as often as needed.",
"       </li>",
"       <li>",
"        Do not touch wild animals, even if they look dead.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If you were bitten by an animal that could have rabies, you need a series of shots to prevent rabies.",
"     </p>",
"     <p>",
"      Some people who work with animals can get shots to help prevent rabies, even if they have never had a scratch or bite. But they still need to see a doctor or nurse and get more shots if an animal that could have rabies bites them. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17588023\">",
"      <span class=\"h1\">",
"       Are rabies shots safe for pregnant women?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Shots to prevent rabies are safe for an unborn baby. If you are pregnant and an animal that could have rabies bites or scratches you, see a doctor or nurse right away. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H17588040\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
