" <div id=\"innerOutline\">",
"  <h1>",
"   TOPIC OUTLINE",
"  </h1>",
"  <div id=\"outline\">",
"   <ul>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F159194\">",
"      Brand Names: U.S.",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015764\">",
"      What is this drug used for?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015763\">",
"      What do I need to tell my doctor before I take this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015768\">",
"      What are some things I need to know or do while I take this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015769\">",
"      What are some side effects of this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015771\">",
"      What are some side effects that I need to call my doctor about right away?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015766\">",
"      How is this drug best taken?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015767\">",
"      What do I do if I miss a dose?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015772\">",
"      How do I store and/or throw out this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10015773\">",
"      General drug facts",
"     </a>",
"    </li>",
"   </ul>",
"  </div>",
"  <h1>",
"   RELATED TOPICS",
"  </h1>",
"  <div id=\"relatedTopics\">",
"   <ul>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_general\" href=\"UTD.htm?34/37/35410?source=related_link\">",
"      Dibucaine: Drug information",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"drug drug_pediatric\" href=\"UTD.htm?15/58/16290?source=related_link\">",
"      Dibucaine: Pediatric drug information",
"     </a>",
