var title_f2_23_2428="Diagnostic criteria for AMR reject of renal allograft";
var content_f2_23_2428=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F82577&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F82577&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic criteria for antibody-mediated rejection of renal allograft",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acute AMR",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Neutrophil/lymphocyte margination (capillaritis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombosis/necrosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C4d+ in peritubular capillaries (PTC)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Circulating anti-donor antibodies (DSA)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T cell mediated rejection*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        ATN*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Chronic AMR",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        1. Histologic evidence of chronic damage (2/4 required)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        - Tubulointerstitial fibrosis/atrophy*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        - Arterial intimal thickening without elastosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        - GBM/TBM duplication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. C4d+ in PTC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. DSA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Suspicious for AMR",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C4d+ in PTC with capillaritis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No DSA",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        No histopathological findings",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    At least three criteria of those listed in the table are required for diagnosis of acute AMR.",
"    <br>",
"     ATN may be the earliest feature of AMR.",
"     <div class=\"footnotes\">",
"      * These may accompany AMR but are not specific AMR features.",
"     </div>",
"     <div class=\"reference\">",
"      Reproduced from: Liapis H, Koch MJ, Mengel M. Kidney. In: Pathology of Solid Organ Transplantation, 1st ed, Liapis H, Wang HL (Eds), Springer, New York 2011, with kind permission from Springer Science + Business Media B.V.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
